import { Link } from "react-router-dom";

const buttonStyle = "bg-black text-white px-4 py-2 rounded-md border border-white";
const linkStyle = "w-fit";

const Navbar = () => {
  return (
    <nav className="bg-blue p-4 flex basis-1/5 gap-2 flex-row md:flex-col">
      <Link to="/contacts" className={linkStyle}>
        <button className={buttonStyle}>
          <div className="border border-white p-2 rounded-md">
            Contacts
          </div>
        </button>
      </Link>
      <Link to="/chartandmaps" className={linkStyle}>
        <button className={buttonStyle}>
          <div className="border border-white p-2 rounded-md">
            Charts & Maps
          </div>
        </button>
      </Link>
    </nav>
  );
};

export default Navbar;
